ISLAMABAD, Aug 25 (APP): Pakistan High Commissioner to the United Kingdom Moazzam Ahmad Khan on Wednesday held a detailed meeting with UK Parliamentary Under Secretary of State Lord Bethel on the red listing issue.
In a virtual meeting, the high commissioner shared the latest data, Pakistan’s COVID-19 response and Pakistan’s expectations from the review process.
